import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.css';
import Loading from './Loading';

const Navbar = () => {
  const [isLoading, setIsLoading] = useState(false);

  const handleToggle = () => {
    setIsLoading(true);
    setTimeout(() => {
      setIsLoading(false);
    }, 3000);
  };

  return (
    <div>
      <nav>
        <ul>
          <li>
            <NavLink exact to="/" activeClassName="active">Home</NavLink>
          </li>
          <li>
            <NavLink to="/credentials" activeClassName="active">Credentials</NavLink>
          </li>
          <li>
            <NavLink to="/search" activeClassName="active">Search</NavLink>
          </li>
          <li>
            <NavLink to="/recipedetails" activeClassName="active">RecipeDetails</NavLink>
          </li>
          <li>
            <NavLink to="/profile" activeClassName="active">Profile</NavLink>
          </li>
          <li>
            <NavLink to="/comments" activeClassName="active">Comments</NavLink>
          </li>
          <li>
            <NavLink to="/ratings" activeClassName="active">Ratings</NavLink>
          </li>
          <li>
            <NavLink to="/recipe-list" activeClassName="active">Recipe List</NavLink>
          </li>
        </ul>
        <button onClick={handleToggle}>Toggle Loading</button>
      </nav>
      {isLoading && <Loading />}
    </div>
  );
};

export default Navbar;
